// client/src/pages/ImDrinking.js
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './ImDrinking.css';
import Navbar from '../components/Navbar';

// Define drink options array (with name, abv, volume).
const drinkOptions = [
  { name: "Jack Daniel's Old No. 7 Tennessee Whiskey", abv: 40, volume: 750 },
  { name: "Jack Daniel's Country Cocktail", abv: 4.8, volume: 355 },
  { name: "Jameson Orange Spirit Drink", abv: 30, volume: 750 },
  { name: "Smirnoff Ice", abv: 4.5, volume: 710 },
  { name: "High Noon Vodka Seltzer", abv: 4.5, volume: 355 },
  { name: "Jameson Black Barrel", abv: 40, volume: 750 },
  { name: "Fireball Cinnamon Whiskey", abv: 33, volume: 50 },
  { name: "Twisted Tea Hard Iced Tea", abv: 5, volume: 355 },
  { name: "White Claw Hard Seltzer", abv: 5, volume: 355 },
  { name: "Dogfish Head Cocktail", abv: 12, volume: 355 },
  { name: "Coors Light Beer Can", abv: 4.2, volume: 355 },
  { name: "Bud Light Beer Bottle", abv: 5, volume: 355 },
  { name: "Corona Extra Beer Bottle", abv: 4.6, volume: 355 },
  { name: "Angry Orchard Hard Cider Bottle", abv: 5, volume: 355 },
  { name: "Casamigos Blanco Tequila", abv: 40, volume: 750 },
  { name: "JINRO Chamisul Soju Fresh", abv: 13, volume: 375 },
  { name: "New Amsterdam Pink Whitney", abv: 40, volume: 375 },
  { name: "Malibu Caribbean Coconut Liquor Rum", abv: 21, volume: 750 },
  { name: "Tito's Handmade Vodka", abv: 40, volume: 750 },
  { name: "Heineken Lager", abv: 5, volume: 355 }
];

export default function ImDrinking() {
  const navigate = useNavigate();
  // State: array of selections (each is a string, drink name)
  const [selections, setSelections] = useState(['']);
  
  const handleChange = (index, value) => {
    const newSelections = [...selections];
    newSelections[index] = value;
    setSelections(newSelections);
  };

  const addRow = () => {
    setSelections([...selections, '']);
  };

  const removeRow = (index) => {
    if(selections.length > 1) {
      const newSelections = selections.filter((_, i) => i !== index);
      setSelections(newSelections);
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Only consider rows with non-empty selection
    const selectedDrinks = selections.filter(s => s.trim() !== '');
    if(selectedDrinks.length === 0) return;
    // Navigate to DrinkDiagram with the selected drinks (encoded as JSON)
    navigate(`/drink-diagram?drinks=${encodeURIComponent(JSON.stringify(selectedDrinks))}`);
  };

  return (
    <div className="im-drinking-container">
      <Navbar onSignOut={() => {
        localStorage.removeItem('bacshotsUser');
        window.location.href = '/signin';
      }} />
      <div className="im-drinking-content">
        <h1>I'm drinking</h1>
        <form onSubmit={handleSubmit}>
          {selections.map((sel, index) => (
            <div key={index} className="drink-row">
              <select 
                value={sel} 
                onChange={(e) => handleChange(index, e.target.value)}
                className="drink-dropdown"
              >
                <option value="" disabled>Select a drink</option>
                {drinkOptions.map((drink, idx) => (
                  <option key={idx} value={drink.name}>{drink.name}</option>
                ))}
              </select>
              <div className="row-buttons">
                {index === selections.length - 1 && (
                  <button type="button" className="add-btn" onClick={addRow}>+</button>
                )}
                {selections.length > 1 && (
                  <button type="button" className="remove-btn" onClick={() => removeRow(index)}>-</button>
                )}
              </div>
            </div>
          ))}
          <button type="submit" className="submit-btn">Tonight</button>
        </form>
      </div>
    </div>
  );
}
